components/amp/styles/footer:
.amp-footer-credits {
  font-size: 13px;
}

.footer-social-list {
  margin-left: 0;
  margin-bottom: 40px;
  list-style: none;
}

.footer-social-list-item {
  display: inline-block;
  vertical-align: middle;
  margin: 0 7.5px;
}

.footer-social-list-item:first-of-type {
  margin-left: 0;
}

.footer-social-list-item:last-of-type {
  margin-right: 0;
}

.footer-social-list-item-icon {
  width: 21px;
  height: 21px;
  vertical-align: middle;
  fill: currentColor;
}
